import React from 'react'
let style = {
    textAlign : 'center',
    width : '100%',
    height : '100vh'
}
function RandomColor() {
  return (
    <div style={style}>
      <img src={htmlcssjs} alt="Khizi"/>
    </div>
  )
}

export default RandomColor
